import Link from 'next/link';
import React, {useState} from "react";

export default function Login() {
    const [login, setLogin] = useState("");
    const [password, setPassword] = useState("");
    const handleLoginChange = (event) => {
        console.log(event)
        const value = event.target.value;
        setLogin(value);
    };

    const handlePasswordChange = (event) => {
        const value = event.target.value;
        console.log(value, "value");
        setPassword(value);
    };

    const handleLogIn = () => {
        if (login === "admin" && password === "admin") {

        }
    };

    return (
        <div>
            <input placeholder="login" value={login} onChange={handleLoginChange}/>
            <input placeholder="password" value={password} onChange={handlePasswordChange}/>
            <button onClick={handleLogIn}>Log in</button>
        </div>
    );
}

import {useEffect, useState} from "react";

const postStyle = {
    display: "flex",
    flexDirection: "column"
};
export default function Post({handlePostListOpen, id}) {
    const [post, setPost] = useState(null);
    useEffect(() => {
        const storage = window.localStorage;
        const postsJson = storage.getItem("posts");
        const posts = JSON.parse(postsJson);
        debugger
        const currentPost = posts.find((post) => post.id === +id);
        if (!currentPost.comments) {
            (
                async () => {
                    const res = await fetch(`https://jsonplaceholder.typicode.com/posts/${id}/comments`);
                    currentPost.comments = await res.json();
                    window.localStorage.setItem("posts", JSON.stringify(posts));
                    setPost(currentPost);
                }
            )().catch((error) => console.log(error))
        }

    }, []);

    const handleBackClick = () => {
        handlePostListOpen();
    };

    return (
        <>
            {
                post ? <div style={postStyle}>
                    <button onClick={handleBackClick}>Back to posts page</button>
                    <span> User: {post.userId}</span>
                    <span>Post Title: {post.title}</span>
                    <span>Post Body: {post.body}</span>
                    <ul>
                        {
                            post.comments &&
                            post.comments.map((comment) => {
                                return (
                                    <li>
                                        <div>Username: {comment.name}</div>
                                        <div>{comment.body}</div>
                                    </li>
                                )
                            })
                        }
                    </ul>
                </div> :
                    <div>Loading...</div>
            }
        </>

    )
}

import {useEffect, useState} from "react";

function PostList({handlePostOpen}) {
    const [posts, setPosts] = useState([]);
    useEffect(() => {
        (
            async () => {
                const res = await fetch(`https://jsonplaceholder.typicode.com/posts`);
                const data = await res.json();

                window.localStorage.setItem("posts", JSON.stringify(data));
                setPosts(data);
            }
        )().catch((error) => console.log(error))
    }, []);

    const handlePostClick = (event) => {
        debugger
        const id = event.currentTarget.getAttribute("data-id");
        handlePostOpen(id)
    };

    return (
        <>
            <div>Posts Page</div>
            <ul>
                {
                    posts.length !== 0 &&
                    posts.map((element) => {
                        return (
                            <li onClick={handlePostClick} data-id={element.id}>
                                <div>User: {element.userId}</div>
                                <div>Post Title: {element.title}</div>
                                <div>Post Body: {element.body}</div>
                            </li>
                        )
                    })
                }
            </ul>
        </>
    )
}

export default PostList

export const pageIds = {
    loginPage: "0",
    postsPage: "1",
    postPage: "2"
};

